import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Login from './pages/Login';  // Assuming Login.js is in a folder named pages
import TaskList from './pages/TaskList';  // Assuming TaskList.js is also in pages folder

const App = () => {
    return (
        <Router>
            <Switch>
                <Route path="/login" component={Login} />
                <Route path="/tasks" component={TaskList} />
                <Route path="/" component={Login} />  {/* Redirect to login by default */}
            </Switch>
        </Router>
    );
};

export default App;
